import React from 'react';
import OverlayTrigger from 'react-bootstrap/OverlayTrigger';
import Tooltip from 'react-bootstrap/Tooltip';
import Carousel from 'react-bootstrap/Carousel';
import Modal from 'react-bootstrap/Modal';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Image from 'react-bootstrap/Image'
import eruditemain from '/u'
import marsmenu from './MenuStyle/Mars_menu.module.scss';


const Mars = ({ marsshow, marsClose, marsShow, pagenumber}) => {

    const renderTooltip = (props) => (
        <Tooltip id={marsmenu.Tooltip} {...props}>
          프로젝트 1
          <p className={marsmenu.p}> Erudite Learning Lab </p>
        </Tooltip>
    );


    return (
    <>
      <OverlayTrigger
      placement="bottom"
      overlay={renderTooltip}
      >
      <div id={marsmenu.mars_menumode} onClick={marsShow} pagenumber={pagenumber}/>
      </OverlayTrigger>

      <Modal
      show={marsshow}
      size="lg"
      id={marsmenu.Modal}
      onHide={marsClose}
      backdrop="static"
      keyboard={false}
      centered
      >
        <Modal.Header  closeButton closeVariant="white" className={marsmenu.Modal_Header}>
          <Modal.Title className={marsmenu.Modal_Title}> 프로젝트 1 (Erudite Learning Lab) </Modal.Title>
        </Modal.Header>
        <Modal.Body className={marsmenu.Modal_Body}>
          <Carousel id={marsmenu.Carousel} interval={null}>
            <Carousel.Item>
              <Container>
                <Row>
                  <Col>
                  <img
                    src="./"
                    className='img-thumbnail'
                    alt='...'
                  />
                  </Col>
                  <Col>
                    Erudite는 대학교 4학년 그룹 프로젝트의 팀명이며, 이 때 진행했던 프로젝트는 "First Steps to Reading Fluency"입니다. 영유아들이 게임을 통해 보다 쉽게 영단어와 알파벳등의 발음을 익히기 쉽게하기 위해 제작되었습니다.
                  </Col>
                </Row>
              </Container>
            </Carousel.Item>

            <Carousel.Item>

            </Carousel.Item>

          </Carousel>
        </Modal.Body>
      </Modal>

        </>
    );
};

export default Mars;
